DROP TABLE IF EXISTS `craft_matrixcontent_partners`;


--
-- Schema for table `craft_matrixcontent_partners`
--
CREATE TABLE `craft_matrixcontent_partners` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `elementId` int(11) NOT NULL,
  `locale` char(12) COLLATE utf8_unicode_ci NOT NULL,
  `field_partner_institutionName` text COLLATE utf8_unicode_ci,
  `field_partner_externalUrl` text COLLATE utf8_unicode_ci,
  `field_partner_heading` text COLLATE utf8_unicode_ci,
  `field_partner_body` text COLLATE utf8_unicode_ci,
  `dateCreated` datetime NOT NULL,
  `dateUpdated` datetime NOT NULL,
  `uid` char(36) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `craft_matrixcontent_partners_elementId_locale_unq_idx` (`elementId`,`locale`),
  KEY `craft_matrixcontent_partners_locale_fk` (`locale`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

